import './App.css';
import Card from './Card';

function App() {
  return (
    <div className="App">
      <Card
        discription="A compelling tale of love and loss, 'The Great Gatsby' by F. Scott Fitzgerald captures the roaring twenties in all its glamour and heartbreak."
        name="The Great Gatsby"
        url="https://images.unsplash.com/photo-1553784418-940ffb851774?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      />
      <Card
        discription="George Orwell's dystopian novel '1984' paints a chilling picture of a totalitarian society under constant surveillance, where even thoughts are controlled."
        name="1984"
        url="https://images.unsplash.com/photo-1524995997946-a1c2e315a42f?q=80&w=1064&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      />
      <Card
        discription="'To Kill a Mockingbird' by Harper Lee explores the serious issues of race and class in the Deep South through the eyes of young Scout Finch."
        name="To Kill a Mockingbird"
        url="https://images.unsplash.com/photo-1512820790803-83ca734da794?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
      />

    </div>
  );
}

export default App;
